import React from "react";
import styles from "./AddTask.module.css";

const TaskSettings = props =>{

    return(
    <Fragment>
      <div className={classes['task-setting-div']}>
        <div className={styles.heading}>Add a new task</div>
        <div className={classes['task-setting-tile']}>
           
        </div>
      </div>
    </Fragment>
    );
}

export default TaskSettings;
